import React, { Component } from "react";
import style from "/style.css";

class InitCharacter extends Component {
  render() {
    return (
      <div className="style.panels">
        <div className="style.panel panel1">
          <p>Hey</p>
          <p>Let's</p>
          <p>Dance</p>
        </div>
        <div className="style.panel panel2">
          <p>Give</p>
          <p>Take</p>
          <p>Receive</p>
        </div>
        <div className="style.panel panel3">
          <p>Experience</p>
          <p>It</p>
          <p>Today</p>
        </div>
      </div>
    );
  }
}

export { InitCharacter };
